import React from 'react';

const LogicQuestions = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Logical Reasoning</h1>
      <div>
        <h2 className="text-xl font-semibold">Question 1</h2>
        <p>What is the next number in the series 2, 6, 12, 20?</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>The answer is 30.</p>
      </div>
      <div className="mt-4">
        <h2 className="text-xl font-semibold">Question 2</h2>
        <p>If A is older than B and B is older than C, who is the youngest?</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>C is the youngest.</p>
      </div>
      {/* Add more questions and answers as needed */}
    </div>
  );
};

export default LogicQuestions;
